import React, { useEffect, useState } from 'react';
import API from '../utils/api';
import NestEggChart from '../components/NestEggChart';

function Dashboard() {
  const [userData, setUserData] = useState({
    age: 24,
    retirementAge: 68,
    annualIncome: 70000,
    incomeIncrease: 5,
    currentSavings: 0,
    annualSavings: 10,
    annualSpending: 40000,
  });
  const [projectionData, setProjectionData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    API.get('/user/me')
      .then(res => setUserData(prev => ({ ...prev, name: res.data.name })))
      .catch(err => setError("Failed to load user data"));

    API.get('/retirement/projection')
      .then(res => setProjectionData(res.data))
      .catch(err => setError("Failed to load projection data"));
  }, []);

  return (
    <div className="p-6 max-w-6xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-6">
      <div className="bg-white p-6 rounded shadow-md">
        <h2 className="text-xl font-bold mb-4">Retirement Calculator</h2>
        <label className="block mb-2">What's your current age?</label>
        <input type="number" value={userData.age} className="w-full p-2 border rounded mb-4" />

        <label className="block mb-2">What age do you plan to retire?</label>
        <input type="number" value={userData.retirementAge} className="w-full p-2 border rounded mb-4" />

        <label className="block mb-2">What's your current annual household income?</label>
        <input type="number" value={userData.annualIncome} className="w-full p-2 border rounded mb-4" />

        <label className="block mb-2">How much do you expect your income to increase?</label>
        <input type="number" value={userData.incomeIncrease} className="w-full p-2 border rounded mb-4" />

        <label className="block mb-2">How much have you saved for retirement so far?</label>
        <input type="number" value={userData.currentSavings} className="w-full p-2 border rounded mb-4" />

        <label className="block mb-2">How much do you plan to save each year for retirement?</label>
        <input type="number" value={userData.annualSavings} className="w-full p-2 border rounded mb-4" />

        <label className="block mb-2">How much money do you plan to spend each year in retirement?</label>
        <input type="number" value={userData.annualSpending} className="w-full p-2 border rounded mb-4" />
      </div>

      <div className="bg-white p-6 rounded shadow-md">
        <h2 className="text-xl font-bold mb-4">Your total savings at retirement</h2>
        <p className="text-3xl font-bold text-blue-600 mb-4">$3,874,958.26</p>
        <p className="text-green-500">You're on track</p>
        <p className="text-gray-600">Savings needed for retirement: <span className="font-bold">$653,183.43</span></p>
        <p className="text-gray-600">Extra savings: <span className="font-bold text-green-500">$3,221,774.83</span></p>
        
        <h2 className="text-lg font-bold mt-6">Your retirement summary</h2>
        <p className="text-gray-600">Your plan provides $3,874,958.26 when you retire. This assumes annual retirement expenses of $40,000.00.</p>
        
        <div className="mt-6">
          {projectionData ? (
            <NestEggChart dataPoints={projectionData.years} />
          ) : (
            <p className="text-gray-600">Loading projection data...</p>
          )}
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
